import React from 'react';
import icon from '../../assets/pix-icon.svg';

interface IState{
  isSidePanelOpen: boolean
}

export default class PiXIcon extends React.Component<{},IState>{
  constructor(props: any){
    super(props);
    this.state = {
      isSidePanelOpen: false
    }
  }

  dropDownToogleClickHandler = () => {
    console.log("Click! +" + this.state.isSidePanelOpen);
    this.setState((prevState: any) => {
      return {isSidePanelOpen: !prevState.isSidePanelOpen}
    });
    console.log(!prevState.isSidePanelOpen);
    console.log(this.state.isSidePanelOpen);
  }

  render(){
    return(
      <div className="PiXIcon-Component">
        <img className="PiX-Icon" src={icon} onClick={this.dropDownToogleClickHandler} alt="icon"/>
      </div>
    );
  }

}
